void delay_ms(unsigned int time) { // 延迟x毫秒
	unsigned int i,j;
	for(i=0;i<time;i++)
		for(j=0;j<250;j++);
}
void SPI_WriteData(unsigned char Data) { // 向SPI总线传输一个8位数据
	unsigned char i=0;
	for(i=8;i>0;i--) {
		if(Data&0x80)
			sda=1; //输出数据
		else sda=0;
		scl=0;
		scl=1;
		Data<<=1;
	}
}
void LCD_WriteIndex(unsigned char Data) { // 向屏幕写入一个8位指令
	cs=0;
	rs=0;
	SPI_WriteData(Data);
	cs=1;
}
void LCD_WriteData(unsigned char Data) { // 向屏幕写入一个8位数据
	unsigned char i=0;
	cs=0;
	rs=1;
	SPI_WriteData(Data);
	cs=1;
}

void LCD_WriteData_16Bit(unsigned int Data) { // 向屏幕写入一个16位数据
	unsigned char i=0;
	cs=0;
	rs=1;
	SPI_WriteData(Data>>8); 
	SPI_WriteData(Data);
	cs=1;
}
	
void LCD_Reset() { // 重置屏幕
	reset=0;
    delay_ms(100);
    reset=1;
    delay_ms(100);
}

