void LCD_SetRegion(unsigned int startX, unsigned int startY, unsigned int endX, unsigned int endY) { // 设置显示区域，在此区域写数据自动换行
	#ifdef USE_LANDSCAPE//使用横屏模式
        LCD_WriteIndex(0x2a);
        LCD_WriteData(0x00);
        LCD_WriteData(startX+3);
        LCD_WriteData(0x00);
        LCD_WriteData(endX+3);

        LCD_WriteIndex(0x2b);
        LCD_WriteData(0x00);
        LCD_WriteData(startY+2);
        LCD_WriteData(0x00);
        LCD_WriteData(endY+2);

#else//竖屏模式        
        LCD_WriteIndex(0x2a);
        LCD_WriteData(0x00);
        LCD_WriteData(startX+2);
        LCD_WriteData(0x00);
        LCD_WriteData(endX+2);

        LCD_WriteIndex(0x2b);
        LCD_WriteData(0x00);
        LCD_WriteData(startY+3);
        LCD_WriteData(0x00);
        LCD_WriteData(endY+3);        
#endif
        LCD_WriteIndex(0x2c);
}
void putPixel(unsigned int x, unsigned int y, unsigned int color) { // 将一个像素设为指定颜色
	LCD_SetRegion(x,y,x+1,y+1);
    LCD_WriteData_16Bit(color);
}
void displaySingleColour(int color) { // 单色填充屏幕
	unsigned char i,j;
	LCD_SetRegion(0,0,128-1,128-1);
	for (i=0;i<128;i++)
		for (j=0;j<128;j++)
			LCD_WriteData_16Bit(color);
}

